arCallbacks.szOnCallbackCompleteScript:
function Start()
	local tPlayers = Hydra.QuestGetParticipants()
	
	-- Apply an exp adjustment for pre-Nevesk to ensure players only level up inside Nevesk.
	for i,idPlayer in pairs(tPlayers) do
		Hydra.BuffApplyToTarget(S_POWER_EXP_ADJUSTER, "PATH_TO_DUNGEON", idPlayer);
		Hydra.BuffRemove(S_POWER_EXP_ADJUSTER, "PRE_NEVESK", idPlayer);
	end
end

function Start(idActorPlayer, idActorVendor)

	Hydra.ActorPlayConversation(CONV_ISBEL, idActorPlayer, idActorVendor)
	
end

function Start(idActorPlayer, idActorVendor)

	Hydra.ActorPlayConversation(CONV_STANIS, idActorPlayer, idActorVendor)
	
end

function Start()
	local tPlayers = Hydra.QuestGetParticipants()
	
	-- Remove all exp adjustments from this quest
	for i,idPlayer in pairs(tPlayers) do
		Hydra.BuffRemove(S_POWER_EXP_ADJUSTER, "PATH_TO_DUNGEON", idPlayer);
		Hydra.BuffRemove(S_POWER_EXP_ADJUSTER, "DUNGEON", idPlayer);
	end
end
